create schema if not exists dvd_rental;

use dvd_rental;

create table actor
(
    actor_id    int       null,
    first_name  text      null,
    last_name   text      null,
    modified_at timestamp null
);

create table address
(
    address_id  int       null,
    address     text      null,
    address2    text      null,
    district    text      null,
    city_id     int       null,
    postal_code double    null,
    phone       double    null,
    modified_at timestamp null
);

create table category
(
    category_id   int       null,
    category_name text      null,
    modified_at   timestamp null
);

create table city
(
    city_id     int       null,
    city        text      null,
    country_id  int       null,
    modified_at timestamp null
);

create table country
(
    country_id  int       null,
    country     text      null,
    modified_at timestamp null
);

create table customer
(
    customer_id int       null,
    store_id    int       null,
    first_name  text      null,
    last_name   text      null,
    email       text      null,
    address_id  int       null,
    create_date date      null,
    modified_at timestamp null
);

create table film
(
    film_id          int       null,
    title            text      null,
    release_year     int       null,
    language_id      int       null,
    rental_duration  int       null,
    rental_rate      double    null,
    replacement_cost double    null,
    rating           text      null,
    modified_at      timestamp null
);

create table film_actor
(
    actor_id    int       null,
    film_id     int       null,
    modified_at timestamp null
);

create table film_category
(
    film_id     int       null,
    category_id int       null,
    modified_at timestamp null
);

create table film_language
(
    language_id   int       null,
    language_name text      null,
    modified_at   timestamp null
);

create table inventory
(
    inventory_id int       null,
    film_id      int       null,
    store_id     int       null,
    modified_at  timestamp null
);

create table payment
(
    payment_id   int       null,
    customer_id  int       null,
    staff_id     int       null,
    rental_id    int       null,
    amount       double    null,
    payment_date timestamp null,
    modified_at  timestamp null
);

create table rental
(
    rental_id    int       null,
    inventory_id int       null,
    customer_id  int       null,
    staff_id     int       null,
    modified_at  timestamp null
);

create table staff
(
    staff_id    int       null,
    first_name  text      null,
    last_name   text      null,
    address_id  int       null,
    email       text      null,
    store_id    int       null,
    active      int       null,
    username    text      null,
    modified_at timestamp null
);

create table store
(
    store_id         int       null,
    manager_staff_id int       null,
    address_id       int       null,
    modified_at      timestamp null
);
































